import React from "react";
import { Text, View } from "react-native";
export const FoodDetail = ({route, navigation}) => {
    const {foodData} = route.params
    return(
        <View style={{
            flex : 1,
            alignItems : 'center',
            padding : 25
        }}
        >
            <Text>{foodData.foodTitle}</Text>
        </View>
    )
}
